INSERT INTO `forum_theme` VALUES ('9','0','1','1','1550176661','0','0','1','Акция','Новая акция!! получаешь огромный бонус даже от 5 руб + подарок твоей дивизии ресурсы! и автоматически расширяет топлевный бак +150 Всем приятной игры!!!!','','forum');
INSERT INTO `forum_theme` VALUES ('10','0','1','1','1550236941','0','0','1','Обновки','Всем здраствуйте сделали больше опыта в бою и серебра изменена иконка опыта и добавляем в игру ресурс "Кристал" ждите обновление!! Всем хорошой игры!!','','forum');
