INSERT INTO `forum_theme` VALUES ('18','0','164','1','1551211650','0','0','1','Розыгрыш за 23 февраля!','Здравствуйте игроки! \r\n\r\nЕсли Вы читаете эту новость, то у Вас есть шанс получить один из уникальных танков.\r\n\r\nРозыгрывается 5 танков (ИС-3 Защитник)///n\r\n3 танка (T28 Defender)///n\r\n2 пакета золота по 8000 золота!\r\n[img]/instalscript/images/nat/TankIS-3Defender.png[/img]\r\n[img]/instalscript/images/nat/TankT28Defender.png[/img]\r\n///n\r\nЧто бы принять участвие в конкурсе, Вам нужно всего лишь перейти в нашу группу ВКонтакте, и сделать репост записи с конкурсом\r\n///n\r\n[b]ВАЖНО:[/b] Если Вы не подписаны на группу, Вы не получаете приз в случае выигрыша.\r\n///n\r\nИтоги: 28.02.2019\r\n\r\n\r\nСпасибо что дочитали, удачи в конкурсе и в боях!','','forum');
INSERT INTO `forum_theme` VALUES ('19','0','164','1','1551219016','0','0','1','Новые танки в игре 26.02.2019','В игру 26.02.2019 было добавленно 3 боевых машины:\r\n///n\r\n1.ИС-3 Защитник ([b]VIII[/b]) - Тяжелый танк, добавлен для конкурса\r\n///n\r\n2. T28 Defender ([b]VIII[/b]) - ПТ-САУ, добавлен для конкурса\r\n///n\r\n3. Grille 15 ([b]X[/b]) - обычный доступный всем танчик!\r\n\r\n///n\r\nЖдите следующих дополнений техники','','forum');
