INSERT INTO `forum_top` VALUES ('11','0','34','1550088696','0','0','250','Мафия','Все роли делятся на две группы:\r\nза честных граждан и за мафию.\r\n\r\nЦель каждой из групп – победить другую. Это можно сделать двумя способами:\r\nПервый - казнить участника другой группировки днем общим голосованием.\r\nВторой - убить его ночью, но это могут только мафиози и маньяк.\r\nДнем все игроки голосуют, кого казнить. Ночью все обычные честные граждане спят, остальные - действуют.\r\n\r\nЦель - остаться живым до конца игры.\r\n\r\nЕсли игрок неактивен, но имеет роль, помимо гражданина, то он не получает наград и может умереть.\r\n','forum');
