INSERT INTO `map` VALUES ('1','Вестфилд','/instalscript/images/map/[type]/westfild.jpg','Яркая и пышная местность со множеством лесов и деревень, расположенных в разных частях карты. Крупный повреждённый акведук пересекает восточную часть долины. Многочисленные горные хребты являются отличным местом для засады, но широкие поля делают перемещение между позициями опасным.');
INSERT INTO `map` VALUES ('2','Жемчужная река','/instalscript/images/map/[type]/jemchureka.jpg','Изрезанный ландшафт открывает огромные возможности для использования различных тактик боя — засад, внезапных обходов, столкновений на небольших участках. Движение вдоль русла реки позволяет быстро добраться до базы противника и вступить в бой. Помните, что на этой карте нельзя забывать о своих тылах.');
INSERT INTO `map` VALUES ('3','Затерянный город','/instalscript/images/map/[type]/zaterengorod.jpg','Cимметричная смешанная карта с тщательно выверенным балансом, созданная при участии ведущих игроков. Сдержанная цветовая палитра и мягкое дневное освещение призваны обеспечить максимальный комфорт при игре.');
INSERT INTO `map` VALUES ('4','Карелия','/instalscript/images/map/[type]/kareliya.jpg','Болота, скалы и каменистые обрывы делят карту на три основных операционных направления. Отсутствие построек и небольшое число скальных укрытий благоприятствуют действиям артиллерии. Для успеха необходимо сосредоточение сил атакующих на одном из направлений при отвлекающих действиях или жёстком сдерживании противника в других секторах.');
INSERT INTO `map` VALUES ('5','Комарин','/instalscript/images/map/[type]/komarin.jpg','Игровая локация представляет собой два участка низменной заболоченной местности. Они разделены рекой, которую можно пересечь по трем мостам. В центре карты находится небольшая возвышенность с обильной растительностью и несколькими постройками. Игроки называют ее «остров», хотя формально это полуостров, примыкающий к северному берегу. Базы расположены на западе и востоке, но команды начинают бой на севере и юге.');
INSERT INTO `map` VALUES ('6','Виндсторм','/instalscript/images/map/[type]/vindstorm.jpg','На карте выделяются два основных направления по флангам и направление поддержки — через центр. Жаркие бои за доминирование в городе будут проходить на двух мостах, соединяющих небольшой завод с центральной площадью. Команда, сумевшая прорвать переправу, получит больше возможностей для обхода противника и тактических манёвров. Зайти в тыл врага и оказать поддержку союзникам, уничтожив вражескую артиллерию, можно через северо-западное направление у подножья горы. Множество укрытий и небольших перепадов высот на протяжении всего маршрута позволят полностью реализовать потенциал быстрой, манёвренной техники. Центральная диагональ — кратчайший маршрут к базе врага, она предоставляет возможность быстро перебросить силы и поддержать союзников на флангах.');
INSERT INTO `map` VALUES ('7','Винтерберг','/instalscript/images/map/[type]/vinterberg.jpg','Карта полностью идентична хорошо известному «Руинбергу», отличаясь от него лишь временем года. Круговая площадь в западной части города служит местом затяжных позиционных боёв. Концентрические городские улицы подойдут для постепенного взлома вражеской обороны силами тяжелобронированной техники, а длинная радиальная улица позволит вести кинжальный огонь по противнику. Восточная область карты довольно открыта и вполне пригодна для манёвров средних танков, но только если они контролируют небольшое поселение посередине этой зоны.');
INSERT INTO `map` VALUES ('8','Заполярье','/instalscript/images/map/[type]/zapolyarie.jpg','Заснеженная и скалистая местность со множеством различных препятствий и укрытий. Извилистые дороги, ведущие вокруг горных массивов и вдоль берега реки, позволяют неожиданно оказаться в тылу у наступающего противника, а также создают множество удобных мест для засад. Предрелизное название — «Линия Маннергейма».');
INSERT INTO `map` VALUES ('9','Зимний Химмельсдорф','/instalscript/images/map/[type]/zimniihimelisdorf.jpg','Карта представляет собой полную копию оригинального Химмельсдорфа, за тем лишь исключением, что это карта зимнего типа. Лабиринт улиц и площадей, крайне неудобный для артиллерии и противотанковых САУ, но идеальный для быстрых прорывов и обходов лёгких и средних танков. Обходные пути — через господствующий над местностью холм с замком и по путям железнодорожного вокзала — помогут выбраться из образовавшегося позиционного тупика.');
INSERT INTO `map` VALUES ('10','Священная долина','/instalscript/images/map/[type]/sveshdolina.jpg','Большую часть местности занимает затерянная в горах лощина. Наличие многочисленных деревушек, высоких скал, деревьев и кустов позволяет выбрать оптимальную тактику ведения боя.');
