INSERT INTO `tank` VALUES ('1','6000','0','Cruiser Mk. I','130','130','130','130','/instalscript/images/tank/easy/britain/TankGB03_Cruiser_Mk_I.png','Британский лёгкий танк. Обладает отличным вооружением, но слабой бронёй и подвижностью. Хорошо подходит для поддержки атаки,также подходит для стрельбы на средние или дальние дистанции чужой разведке.','britain','easy','II');
INSERT INTO `tank` VALUES ('2','2800','0','Renault NC-31','86','86','86','86','/instalscript/images/tank/easy/china/TankCh06_Renault_NC31.png','Китайски лёгкий танк. Является модификацией французского лёгкого танка RenaultFT. Предшественник лёгкого танка Vickers Mk. R Type B.','china','easy','I');
INSERT INTO `tank` VALUES ('3','2900','0','Renault FT','95','95','95','95','/instalscript/images/tank/easy/france/TankRenaultFT.png','Французский лёгкий танк. Отличается неплохим бронированием, хорошей манёвренностью, отличной динамикой и вооружением для ближнего боя. Предшественник лёгких танков D1 и Hotchkiss H3,САУ RenaultB5 и ПТ-САУ Renault AC. ','france','easy','I');
INSERT INTO `tank` VALUES ('4','2750','0','Leichttraktor','93','93','93','93','/instalscript/images/tank/easy/germany/TankLtraktor.png','Немецкий лёгкий танк. Отличается лучшим обзором на уровне, что, в совокупности с неплохим орудием, позволяет играть на любых дистанциях. На выбор также есть хороши автомат, подходящий для ближнего боя. Предшественник лёгких танков Pz.Kpfw. 1,Pz.Rpfw 35(t) и PzKpfw 2, ПТ-САУ Panzerjager и САУ G.PZ. Mk. 6(e).','germany','easy','I');
INSERT INTO `tank` VALUES ('5','3000','0','Renault Otsu','100','100','100','100','/instalscript/images/tank/easy/japan/TankRenaultOtsu.png','Разработан во франции как проект модернизации танка Renault FT. Работы велись с 1925 по 1928 г. После закрытия программы модернизации модель была представлена на рынке. В 1929 году десять танков были приобретены Японией и получили обозначение Otsu-Gata Senscha (танк модель B). Японские машины были частично модернизированы как боевые и учебные танки.','japan','easy','I');
INSERT INTO `tank` VALUES ('6','3100','0','T1 Cunningham','105','105','105','105','/instalscript/images/tank/easy/usa/TankT1_Cunningham.png','Американский лёгкий танк. Обладает отличными динамическими характеристиками и широким выбором вооружения, однако слабым бронированием и задним расположением башни. При использовании пулеметного вооружения способен уничтожить противника с одного полного барабана. Предшественник лёгкого танка M2 Light Tank, среднего T2 MT, ПТ-САУ T18 и САУ T57.','usa','easy','I');
INSERT INTO `tank` VALUES ('7','3200','0','MC-1','110','110','110','110','/instalscript/images/tank/easy/ussr/TankMS-1.png','Советский лёгкий танк. Главная особенность танка - 45 мм орудие. Слабая динамика, невысокая точность, долгое сведение и один  из самых маленьких запасов прочности в игре компенсируется отличными скорострельностью, бронепробиваемостью и уроном.','ussr','easy','I');
INSERT INTO `tank` VALUES ('8','6000','0','M2','130','130','130','130','/instalscript/images/tank/easy/britain/TankGB14_M2.png','Американский лёгкий танк. В Великобританию по ленд-лизу поставлялась модель М2А4, которая выпускалась с 1940 по 1942 год. Всего весной 1941 года в Великобританию было поставлено четыре танка этого типа.','britain','easy','II');
INSERT INTO `tank` VALUES ('9','9000','0','Cruiser Mk. III','160','160','160','160','/instalscript/images/tank/easy/britain/TankGB58_Cruiser_Mk_III.png','Лёгкий танк со слабой бронёй и хорошей мобильностью. Хороший выбор вооружения позволяет успешно действовать на любой дистанции боя — скорострельный пулемёт позволяет буквально изрешетить вражеский танк в упор, двухфунтовое орудие успешно поражает даже самые крепкие цели издалека, а зенитное орудие представляет собой сочетание обоих вариантов.\r\n\r\nПредшественник лёгкого танка Cruiser Mk. IV.','britain','easy','III');
INSERT INTO `tank` VALUES ('10','12000','0','Light Mk. VIC','190','190','190','190','/instalscript/images/tank/easy/britain/TankGB76_Mk_VIC.png','Модификация лёгкого танка Mk.VI с усиленным вооружением — 15-мм пулемётом Besa. Выпускался с декабря 1939 по июнь 1940 года. Танки этого типа изначально предназначались для службы в колониях. Всего было выпущено 130 танков Mk.VIС.','britain','easy','IV');
INSERT INTO `tank` VALUES ('11','15000','0','Stuart I-IV','220','220','220','220','/instalscript/images/tank/easy/britain/TankGB15_Stuart_I.png','Выпускался серийно с 1941 года. Поставлялся по ленд-лизу в Великобританию. Всего было поставлено 6889 машин различных модификаций от М3 до М5А1. По принятой в Великобритании системе обозначений танки М3 получали обозначение Stuart I, а танки М3А1 — Stuart III. Впервые использовались в бою в ноябре 1941 года в сражении у Сиди-Резег.','britain','easy','V');
INSERT INTO `tank` VALUES ('12','5600','0','Vickers Mk. E Type B','116','116','116','116','/instalscript/images/tank/easy/china/TankCh07_Vickers_MkE_Type_BT26.png','Китайский лёгкий танк. Отличается неплохой манёвренностью, малой бронёй и орудием с кассетным заряжанием. Предшественник лёгкого танка Type 2597 Chi-Ha.','china','easy','II');
INSERT INTO `tank` VALUES ('13','8400','0','Vickers Mk. E Type A','146','146','146','146','/instalscript/images/tank/easy/china/TankCh08_Type97_Chi_Ha.png','Нет описания','china','easy','III');
INSERT INTO `tank` VALUES ('14','11200','0','M5A1 Stuart','176','176','176','176','/instalscript/images/tank/easy/china/TankCh09_M5.png','Китайский лёгкий танк, близкий родственник американского M5 Stuart. Обладает отличной подвижностью, неплохим вооружением, хорошим для своего уровня обзором и слабым бронированием. Может выполнять как роль разведчика, так и роль среднего танка. Предшественник среднего танка Type T-34.','china','easy','IV');
INSERT INTO `tank` VALUES ('15','14000','0','59-16','236','236','236','236','/instalscript/images/tank/easy/china/TankCh15_59_16.png','Китайский лёгкий танк. Обладает неплохими динамическими характеристиками, но низкой бронепробиваемостью орудий и большими габаритами.\r\n\r\nПредшественник лёгкого танка WZ-131.','china','easy','VI');
INSERT INTO `tank` VALUES ('16','5800','0','D1','125','125','125','125','/instalscript/images/tank/easy/france/TankD1.png','Французский лёгкий танк. Обладает хорошим бронированием, неплохой манёвренностью, но низкой подвижностью и вооружением для ближнего боя.\r\n\r\nПредшественник среднего танка D2.','france','easy','II');
INSERT INTO `tank` VALUES ('17','8700','0','Hotchkiss H35','155','155','155','155','/instalscript/images/tank/easy/france/TankD1.png','Французский лёгкий танк. Отличается хорошей броней, но посредственным вооружением и слабой динамикой, что вкупе с низкой скоростью делает его малопригодным для ведения манёвренного боя. Однако в роли защитника танк смотрится куда лучше - броня танка способна выдержать немало попаданий, а слабость вооружения становится не такой критичной на ближних и средних дистанциях.\r\n\r\nПредшественник лёгкого танка AMX 38.','france','easy','III');
INSERT INTO `tank` VALUES ('18','11600','0','AMX 38','185','185','185','185','/instalscript/images/tank/easy/france/TankAMX38.png','Французский лёгкий танк. Обладает хорошим бронированием, но плохими скоростью и манёвренностью. Кроме того, у танка довольно посредственное вооружение, не отличающееся точностью.\r\n\r\nПредшественник лёгкого французского танка AMX 40.','france','easy','IV');
INSERT INTO `tank` VALUES ('19','14500','0','AMX 40','215','215','215','215','/instalscript/images/tank/easy/france/TankAMX40.png','Французский лёгкий танк. Имеет лучшую защищённость на своем уровне за счёт толстой рикошетной брони. Однако подвижность оставляет желать лучшего, да и вооружение не может похвастаться большой огневой мощью.\r\n\r\nПредшественник лёгкого танка AMX ELC bis.','france','easy','V');
INSERT INTO `tank` VALUES ('20','5500','0','Pz.Kpfw. II Ausf. D','123','123','123','123','/instalscript/images/tank/easy/germany/TankG108_PzKpfwII_AusfD.png','Быстроходная модификация Pz. II для оснащения лёгких дивизий, созданных на базе кавалерийских. Танк Pz.Kpfw. II Ausf. D имел совершенно новый корпус и ходовую часть, а башня с вооружением была заимствована у Ausf. С. Ходовая часть включала восемь сдвоенных опорных катков большого диаметра с индивидуальной торсионной подвеской без поддерживающих катков. Танки с усиленными элементами подвески и с новыми ведущими и направляющими колёсами получили обозначение Ausf. Е. По разным данным, произведено 200–250 машин модификаций D и E.','germany','easy','II');
INSERT INTO `tank` VALUES ('21','8250','0','Pz.Kpfw. 38H 735 (f)','153','153','153','153','/instalscript/images/tank/easy/germany/TankH39_captured.png','Немецкий премиумный лёгкий танк, представляет собой трофейный французский танк Hotchkiss, переоборудованный под немецкие стандарты — изменена командирская башенка, установлена немецкая рация. Отличается довольно точным орудием, лучшим среди легких танков своего уровня, обзором и мощным бронированием, а также довольно низкой подвижностью.','germany','easy','III');
INSERT INTO `tank` VALUES ('22','11000','0','Pz.Kpfw. 35 (t)','183','183','183','183','/instalscript/images/tank/easy/germany/TankPz35t.png','Немецкий легкий танк с довольно мощным и точным орудием или автоматической пушкой на выбор. Лобовая броня довольная толстая и способна выдерживать немало попаданий. Однако борта тонкие, а башня вращается довольно медленно - всё это вынуждает быть осторожным в ближнем бою. Предшественник немецкого легкого танка PzKpfw 38 (t)','germany','easy','IV');
INSERT INTO `tank` VALUES ('23','13750','0','Pz.Kpfw. I','213','213','213','213','/instalscript/images/tank/easy/germany/TankPzI.png','Немецкий лёгкий танк, имеющий слабое бронирование, отличную манёвренность, неплохой обзор и хорошую радиостанцию. Вооружение составляют скорострельные автоматические пушки, хорошо подходящие для ближнего боя. Башня с вооружением смещена к правому борту. Предшественник лёгкого танка Pz.Kpfw. I Ausf. C.','germany','easy','V');
INSERT INTO `tank` VALUES ('24','6000','0','Type 95 Ha-Go','130','130','130','130','/instalscript/images/tank/easy/japan/TankHa_Go.png','Японский лёгкий танк, также известный как Type 95. Разрабатывался в 1933–1935 годах как машина поддержки кавалерийских частей. Тем не менее, часто применялся в качестве танка сопровождения пехоты. Первый опытный образец был построен компанией Mitsubishi. Серийное производство танка было развёрнуто в 1936 году и продолжалось до 1943 года. Всего было выпущено 2378 машин.','japan','easy','II');
INSERT INTO `tank` VALUES ('25','9000','0','Type 97 Te-Ke','160','160','160','160','/instalscript/images/tank/easy/japan/TankTe_Ke.png','Тип 97 Те-Ке — японский лёгкий танк. Из положительных характеристик машины стоит отметить хорошее орудие, низкий силуэт и большой боезапас, а из отрицательных — тонкую броню, плохую подвижность и чрезвычайную загруженность командира, которая катастрофически сказывается на боеспособности танка при его контузии.','japan','easy','III');
INSERT INTO `tank` VALUES ('26','12000','0','Type 98 Ke-Ni','190','190','190','190','/instalscript/images/tank/easy/japan/TankKe_Ni.png','Разрабатывался компанией Hino Jidosha Kogyo как дальнейшее улучшение Ha-Go. Были улучшены динамические характеристики танка, но вытеснить в производстве Ha-Go эта машина не смогла. Всего компаниями Mitsubishi и Hino было выпущено около 100 танков.','japan','easy','IV');
INSERT INTO `tank` VALUES ('27','15000','0','Type 98 Ke-Ni Otsu','220','220','220','220','/instalscript/images/tank/easy/japan/TankKe_Ni_B.png','Разрабатывался компанией Hino Jidosha Kogyo как дальнейшее улучшение Ha-Go. Были улучшены динамические характеристики танка, но вытеснить в производстве Ha-Go эта машина не смогла. Всего компаниями Mitsubishi и Hino было выпущено около 100 танков.','japan','easy','V');
INSERT INTO `tank` VALUES ('28','6200','0','M2 Light Tank','135','135','135','135','/instalscript/images/tank/easy/usa/TankM2_lt.png','Американский лёгкий танк. Обладает отличной рацией, хорошими обзором и динамическими характеристиками. Может исполнять как роль разведчика, так и штурмового танка.\r\n\r\nПредшественник лёгкого танка M3 Stuart.','usa','easy','II');
INSERT INTO `tank` VALUES ('29','9300','0','T1E6','165','165','165','165','/instalscript/images/tank/easy/usa/TankT1_E6.png','Развитие T1 Cunningham с башней по центру и подвеской Виккерса, как у T2 Light Tank. Отличается неплохой подвижностью и кассетным 37 мм орудием с высокой скорострельностью. Несмотря на очень слабую броню, данный танк вынужден действовать на ближней-средней дистанции — в дальнем бою начинает сказываться слабость обзора, точности, а самое главное — бронепробития.','usa','easy','III');
INSERT INTO `tank` VALUES ('30','12400','0','T2 Light Tank','195','195','195','195','/instalscript/images/tank/easy/usa/TankT2_lt.png','Американский премиумный лёгкий танк. Предназначен для разведки или же для стремительных обходов противника по флангам, так как имеет отменную скорость. Несмотря на «картонную» броню и слабое вооружение, имеет все шансы поразить любого противника, с которым он может столкнуться, особенно используя подкалиберные снаряды.','usa','easy','IV');
INSERT INTO `tank` VALUES ('31','15500','0','T7 Combat Car','225','225','225','225','/instalscript/images/tank/easy/usa/TankT7_Combat_Car.png','Лёгкая колёсно-гусеничная машина с пулемётным вооружением разрабатывалась для американской кавалерии. В апреле 1937 года к испытаниям был подготовлен первый прототип. Испытания машины продолжились до 1939 года. В дальнейшем кавалерия США отказалась от Т7, сделав выбор в пользу чисто гусеничных боевых машин.','usa','easy','V');
INSERT INTO `tank` VALUES ('33','9600','0','БТ-2','170','170','170','170','/instalscript/images/tank/easy/ussr/TankBT-2.png','Советский лёгкий танк. Обладает высокой скоростью, но посредственной манёвренностью. Слабая броня и длинный корпус не добавляют этому танку живучести, однако, благодаря скорости, захват и сбивание захвата базы, перемещение с фланга на фланг танк осуществляет с лёгкостью. С удельной мощностью 42 л.с./т один из самых энерговооруженных танков в игре.\r\n\r\nПредшественник лёгкого танка III уровня БТ-7.','ussr','easy','III');
INSERT INTO `tank` VALUES ('34','12800','0','Т-26','200','200','200','200','/instalscript/images/tank/easy/ussr/TankT-26.png','Советский легкий танк. Обладает средней скоростью и тонкой броней. Благодаря мощному вооружению и хорошей динамике, может прекрасно работать как из укрытия на средних, так и на ближних дистанциях.\r\n\r\nПредшественник лёгкого танка Т-46.','ussr','easy','IV');
INSERT INTO `tank` VALUES ('35','16000','0','Т-60','230','230','230','230','/instalscript/images/tank/easy/ussr/TankT-60.png','Советский лёгкий танк. Ключевые особенности - низкий силуэт, 37 мм-орудие с отличным бронепробитием, долгим сведением и приемлемой точностью. Так же Т-60 обладает неплохим бронированием, рациональные углы наклона брони часто дают рикошеты от попаданий из полуавтоматических орудий. Однако запас прочности танка невелик, а также он уступает многим в своём классе в подвижности. Предшественник лёгкого танка Т-70.','ussr','easy','V');
INSERT INTO `tank` VALUES ('36','25600','0','А-32','400','400','400','400','/instalscript/images/tank/normal/ussr/TankA-32.png','Советский акционный средний танк с динамическими характеристиками легкого. Способен вести разведывательные операции и уничтожать артиллерию противника.','ussr','normal','IV');
INSERT INTO `tank` VALUES ('37','25600','0','Т-28','400','400','400','400','/instalscript/images/tank/normal/ussr/TankT-28.png','Советский средний танк. Отличается хорошей подвижностью, неплохим обзором и вооружением. Однако сочетание больших габаритов и очень тонкой брони делает танк хорошей мишенью и располагает к снайперской тактике или поддержке со второй линии — благо, точность топового 57-мм орудия этому весьма способствует.\r\n\r\nПредшественник тяжёлого танка КВ-1.','ussr','normal','IV');
INSERT INTO `tank` VALUES ('38','32000','0','Матильда IV','460','460','460','460','/instalscript/images/tank/normal/ussr/TankMatilda_II_LL.png','Советский премиумный средний танк. Обладает низкой скоростью, хорошим обзором и достаточно мощной, но слабопробивной пушкой. Хорошо действует в обороне, но при должной сноровке даже может использоваться как танк прорыва.','ussr','normal','V');
INSERT INTO `tank` VALUES ('39','32000','0','Т-34','460','460','460','460','/instalscript/images/tank/normal/ussr/TankR04_T-34.png','Легендарный советский танк. За счёт хорошей мобильности и высокой скорострельности может применяться как типичный СТ в маневренном бою с группой себе подобных. Однако высокая точность 57 мм орудия позволяет использовать и снайперскую тактику.\r\n\r\nПредшественник легкого танка МТ-25 и средних танков Т-34-85 и А-43, а также, есть переход на ПТ-САУ СУ-85.','ussr','normal','V');
INSERT INTO `tank` VALUES ('40','38400','0','А-43','520','520','520','520','/instalscript/images/tank/normal/ussr/TankA43.png','Советский средний танк. Обладает сравнительно неплохой динамикой и манёвренностью. Типичное для всех СТ 6 уровня слабое бронирование, обладающее, однако, рациональными углами наклона. Явным минусом танка является его вооружение (несмотря на высокое пробитие, точность и скорострельность), разовый урон не позволяет ввязываться в быструю контактную перестрелку в одиночку, а малый запас прочности не позволит долго жить в затяжных боях.\r\n\r\nПредшественник среднего танка А-44.','ussr','normal','VI');
INSERT INTO `tank` VALUES ('41','16500','0','Großtraktor - Krupp','206','206','206','206','/instalscript/images/tank/normal/germany/TankG100_Gtraktor_Krupp.png','Акционный немецкий средний танк. Обладает неплохой подвижностью, но весьма специфичным орудием, большими габаритами вкупе со слабой бронёй, что в итоге требует очень аккуратной тактики применения.','germany','normal','III');
INSERT INTO `tank` VALUES ('42','16500','0','Pz.Kpfw. IV Ausf. A','206','206','206','206','/instalscript/images/tank/normal/germany/TankPz_IV_AusfA.png','Разработка танка началась в 1935 году. В апреле 1936 года машина получила обозначение Pz Kpfw IV. Осенью 1937 года начался серийный выпуск, и в январе 1938 года первые три танка поступили в войска. Всего было выпущено 35 машин, которые состояли на вооружении до весны 1941 года.','germany','normal','III');
INSERT INTO `tank` VALUES ('43','16500','0','Pz.Kpfw. S35 739 (f)','206','206','206','206','/instalscript/images/tank/normal/germany/TankS35_captured.png','Из 400 машин, находящихся в составе французской армии, часть была захвачена немцами. Использовались как учебные и на второстепенных фронтах.','germany','normal','III');
INSERT INTO `tank` VALUES ('44','16500','0','Pz.Kpfw. III','206','206','206','206','/instalscript/images/tank/normal/germany/TankPzIII_AusfJ.png','Немецкий СТ. Прочная лобовая броня, отличная подвижность и хорошее вооружение делают этот танк грозным противником как против одноклассников, так и против высокоуровневых противников.\r\n\r\nПредшественник среднего танка Pz.Kpfw. III/IV.','germany','normal','III');
INSERT INTO `tank` VALUES ('45','22000','0','Pz.Kpfw. IV Ausf. D','266','266','266','266','/instalscript/images/tank/normal/germany/TankPz_IV_AusfD.png','Выпуск этой модификации танка Pz IV начался в октябре 1939 года. Основными отличиями стали усиленное бронирование и наружное расположение маски пушки. За время серийного выпуска, который продолжался до мая 1940 года, было выпущено 229 машин этого типа.','germany','normal','IV');
INSERT INTO `tank` VALUES ('46','12400','0','T2 Medium Tank','270','270','270','270','/instalscript/images/tank/normal/usa/TankT2_med.png','Американский средний танк. Обладает широким выбором вооружения и хорошей динамикой, но слабым бронированием при крупных габаритах. Из-за низких точности и бронепробития для T2 Medium Tank предпочтительнее манёвренный ближний бой, поэтому танк эффективно может использоваться как для поддержки атаки, так и для активной разведки.\r\n\r\nПредшественник среднего танка M2 Medium Tank.','usa','normal','II');
INSERT INTO `tank` VALUES ('47','18600','0','M2 Medium Tank','330','330','330','330','/instalscript/images/tank/normal/usa/TankM2_med.png','Американский средний танк. Обладает хорошими динамическими характеристиками и вооружением, но слабым круговым бронированием.\r\n\r\nПредшественник среднего танка 4 уровня M3 Lee.','usa','normal','III');
INSERT INTO `tank` VALUES ('48','24800','0','M3 Lee','390','390','390','390','/instalscript/images/tank/normal/usa/TankM3_Grant.png','Американский средний танк. В силу отсутствия поддержки многобашенности в игре, он вынужден обходиться только 75 мм пушкой в бортовом спонсоне. Из преимуществ танка - мощное и скорострельное орудие и лобовая броня, которая успешно защищает от малокалиберных орудий.\r\n\r\nПредшественник тяжелого танка V уровня T1 Heavy Tank и среднего M4 Sherman.\r\n','usa','normal','IV');
INSERT INTO `tank` VALUES ('49','31000','0','M4A2E4 Sherman','450','450','450','450','/instalscript/images/tank/normal/usa/TankM4A2E4.png','Экспериментальная модель Шермана с торсионной подвеской. Отличается усиленной лобовой броней, а также возросшей скоростью и проходимостью. Однако из-за менее мощного двигателя динамика довольно посредственная, боковая и кормовая броня легко пробиваются, ибо лишены наклонов.\r\n\r\nНа европейском и американском серверах выдавался участникам закрытого бета-теста с 1000 и более боёв.','usa','normal','V');
INSERT INTO `tank` VALUES ('50','31000','0','M4 Sherman','450','450','450','450','/instalscript/images/tank/normal/usa/TankM4_Sherman.png','Американский средний танк. Обладает отличными манёвренностью, обзором, углами вертикальной наводки и гибким выбором вооружения, но высоким силуэтом и слабым бортовым бронированием.\r\n\r\nПредшественник средних танков M4A3E8 Sherman и M4A3E2 Sherman Jumbo.\r\n','usa','normal','V');
INSERT INTO `tank` VALUES ('51','6000','0','Vickers Medium Mk. I','200','200','200','200','/instalscript/images/tank/normal/britain/TankGB01_Medium_Mark_I.png','Британский средний танк. Обладает мощным вооружением и высокой прочностью, однако слабой подвижностью и бронированием, что при большом силуэте делает из него лёгкую мишень. Подходит для поддержки атаки или ведения огня из укрытий. Предшественник легких танков Cruiser Mk. III и Cruiser Mk. I, среднего танка Vickers Medium Mk. II, ПТ-САУ Universal Carrier 2-pdr и АРТ-САУ Loyd Gun Carriage.','britain','normal','I');
INSERT INTO `tank` VALUES ('52','12000','0','Vickers Medium Mk. II','260','260','260','260','/instalscript/images/tank/normal/britain/TankGB05_Vickers_Medium_Mk_II.png','Британский средний танк. обладает мощным вооружением и неплохой подвижностью, но слабой бронёй и большим силуэтом. Подходит для поддержки атаки или для стрельбы по чужой разведке, однако очень уязвим в ближнем бою.\r\n\r\nПредшественник среднего танка Vickers Medium Mk. III.','britain','normal','II');
INSERT INTO `tank` VALUES ('53','18000','0','Vickers Medium Mk. III','320','320','320','320','/instalscript/images/tank/normal/britain/TankGB06_Vickers_Medium_Mk_III.png','Британский средний танк, также известный как Vickers «16-tonners». С 1926 по 1931 год фирма Vickers выпустила три прототипа. По некоторым данным, в 1933 году было выпущено три серийных танка, состоявших на вооружении британской армии до 1938 года. В боевых действиях танк не применялся. Предшественник среднего танка Matilda.','britain','normal','III');
INSERT INTO `tank` VALUES ('54','24000','0','Matilda','380','380','380','380','/instalscript/images/tank/normal/britain/TankGB07_Matilda.png','Британский средний танк. Отличается хорошим вооружением и обзором, отличным бронированием, но весьма низкой подвижностью. На выбор имеется неточная, но мощная гаубица с низким пробитием или маломощная, но точная пушка с отличным бронепробитием. Предшественник тяжёлого танка Churchill I.','britain','normal','IV');
INSERT INTO `tank` VALUES ('55','24000','0','Grant','380','380','380','380','/instalscript/images/tank/normal/britain/TankGB17_Grant_I.png','Американский средний танк M3 первой серии. Был выпущен специально для поставки в Великобританию, где получил обозначение General Grant (Grant I).','britain','normal','IV');
INSERT INTO `tank` VALUES ('56','17400','866','D2','310','310','310','310','/instalscript/images/tank/normal/france/TankD2.png','Французский средний танк. Является дальнейшим развитием D1: усилено бронирование и вооружение. Как и предшественник, обладает очень низкой мобильностью, что вынуждает заранее выбирать и продумывать направление движения. На поле боя зачастую отыгрывает роль тяжёлого танка.\r\n\r\nПредшественник тяжёлого танка B1.','france','normal','III');
INSERT INTO `tank` VALUES ('57','46400','980','AMX CDC','550','550','550','550','/instalscript/images/tank/normal/france/TankF68_AMX_Chasseur_de_char_46.png','Аванпроект новой машины был представлен компанией AMX в 1946 году. Мощный двигатель и небольшой вес должны были обеспечить новой машине отличную подвижность, а 90-мм орудие с механизированной боеукладкой — хорошую скорострельность. Однако значительные размеры при довольно слабом бронировании, а так же весьма сложная и дорогая конструкция не были одобрены комиссией. Существовал только в эскизах.','france','normal','VIII');
INSERT INTO `tank` VALUES ('58','52200','894','Lorraine 40 t','610','610','610','610','/instalscript/images/tank/normal/france/TankLorraine40t.png','Французский средний танк, обладает неплохим вооружением, шикарной подвижностью и хорошим обзором. Среди недостатков выделяется крайне слабое бронирование и немалый размер.\r\n\r\nПредшественник французского среднего танка Bat Chatillon 25t.','france','normal','IX');
INSERT INTO `tank` VALUES ('59','58000','901','Bat.-Châtillon 25 t','670','670','670','670','/instalscript/images/tank/normal/france/TankBat_Chatillon25t.png','Французский средний танк. Обладает динамикой на уровне лёгких танков, барабанной системой зарядки, а также меньшими габаритами по сравнению с предшественником. Однако слабое бронирование, небольшой запас прочности и малый боекомплект осложняют игру в затяжных боях, а самая слабая по характеристикам пушка среди всех СТ 10 не позволяет вести точный огонь на дальние дистанции.\r\n','france','normal','X');
INSERT INTO `tank` VALUES ('60','28000','0','Type T-34','412','412','412','412','/instalscript/images/tank/normal/china/TankCh21_T34.png','Китайский средний танк.\r\n\r\nПредставляет собой всё тот же советский Т-34. Соответственно, тактика применения совершенно аналогична: действия в группе средних танков, прорыв в тыл противника, а при необходимости — снайперская тактика.\r\n\r\nЯвляется предшественником лёгкого танка 59-16 и среднего Type 58.','china','normal','V');
INSERT INTO `tank` VALUES ('61','33600','0','Type 58','472','472','472','472','/instalscript/images/tank/normal/china/TankCh20_Type58.png','Китайский средний танк, вариант советского Т-34-85. Отличается отличной подвижностью, но относительно слабым орудием и недостаточным бронированием. Предшественник среднего танка T-34-1 и тяжёлого танка IS-2.','china','normal','VI');
INSERT INTO `tank` VALUES ('62','39200','0','T-34-1','532','532','532','532','/instalscript/images/tank/normal/china/TankCh04_T34_1.png','Китайский средний танк для ближнего боя. Отличается хорошей скоростью и маневренностью. Обладает хорошо бронированной башней, но слабо бронированным корпусом.\r\n\r\nПредшественник среднего танка T-34-2.','china','normal','VII');
INSERT INTO `tank` VALUES ('63','44800','0','Type 59','592','592','592','592','/instalscript/images/tank/normal/china/TankCh01_Type59.png','Китайский акционный средний танк. Обладает крепкой лобовой бронёй, но малым боезапасом и посредственной динамикой.','china','normal','VIII');
INSERT INTO `tank` VALUES ('64','44800','0','T-34-2','592','592','592','592','/instalscript/images/tank/normal/china/TankCh05_T34_2.png','Китайский средний танк. Как и предшественник, обладает хорошими динамическими показателями, слабым бронированием корпуса и мощными орудиями.\r\n\r\nПредшественник среднего танка WZ-120.','china','normal','VIII');
INSERT INTO `tank` VALUES ('65','12000','0','Chi-Ni','260','260','260','260','/instalscript/images/tank/normal/japan/TankChi_Ni.png','Разрабатывался специалистами Osaka Artillery Arsenal для замены Type 2589. В 1937 г. были проведены совместные испытания прототипов Chi-Ni и Chi-Ha. Прототип Chi-Ha был признан лучшим в ходе испытаний. Был выпущен один опытный образец.','japan','normal','II');
INSERT INTO `tank` VALUES ('66','18000','0','Type 97 Chi-Ha','320','320','320','320','/instalscript/images/tank/normal/japan/TankChi_Ha.png','Разработан японской компанией Mitsubishi в 1935–1937 гг. Выпускался серийно с 1938 по 1942 год, а в 1941–1942 одновременно с модернизированным вариантом Shinhoto Chi-Ha. Всего было выпущено 2880 машин обоих типов. Танки Chi-Ha и Shinhoto Chi-Ha активно использовались японскими войсками в Китае. После капитуляции Японии применялись в Гражданской войне 1946–1949 гг. войсками НОАК и армией Гоминьдана.','japan','normal','III');
INSERT INTO `tank` VALUES ('67','24000','0','Type 1 Chi-He','380','380','380','380','/instalscript/images/tank/normal/japan/TankChi_Ha.png','Средний танк Type 1 Chi-He разработан в 1941 году. Являлся дальнейшим развитием танка Type 97 Chi-Ha. Однако из-за недостатка стали массовое производство началось только в 1943 году. Всего было выпущено 170 машин, большинство из которых использовались в Японии, но не принимали участие в боевых действиях.','japan','normal','IV');
INSERT INTO `tank` VALUES ('68','30000','0','Type 3 Chi-Nu','440','440','440','440','/instalscript/images/tank/normal/japan/TankChi_Nu.png','Средний танк Type 3 Chi-Nu представляет собой модификацию танка Тype 1 Chi-He с новой башней и пушкой. Это был наиболее мощный из серийно выпускавшихся Японией танков, отвечающий современным требованиям. Однако из-за нехватки комплектующих и материалов было выпущено всего 60 машин.\r\n\r\nПредшественник среднего танка Type 4 Chi-To.','japan','normal','V');
INSERT INTO `tank` VALUES ('69','30000','0','Type 3 Chi-Nu Kai','440','440','440','440','/instalscript/images/tank/normal/japan/TankChi_Nu_Kai.png','Средний танк Type 3 Chi-Nu Kai представляет собой сочетание ходовой и корпуса танка Type 3 Chi-Nu и башни с орудием Type 4 Chi-To. Был выпущен один опытный образец, испытания которого начались в марте 1945 года.','japan','normal','V');
INSERT INTO `tank` VALUES ('70','46650','0','Черчилль III','1020','1020','1020','1020','/instalscript/images/tank/hard/ussr/TankChurchill_LL.png','Советский премиумный тяжёлый танк, обладающий хорошей броней, средним на своём уровне вооружением, но посредственной динамикой. Может использоваться как тяжелый танк первой линии. Из-за большой массы способен вести прицельный огонь в движении.','ussr','hard','V');
INSERT INTO `tank` VALUES ('72','46650','0','КВ-1С','1020','1020','1020','1020','/instalscript/images/tank/hard/ussr/TankKV-1s.png','КВ-1С является дальнейшим развитием серии тяжёлых танков КВ-1. Разработан летом 1942 года. 20 августа 1942 года принят на вооружение РККА. По сравнению с предшественниками КВ-1С имел ряд конструктивных особенностей, благодаря которым масса танка была снижена до 42,3 т, увеличены скорость, манёвренность и надёжность машины. Однако оставшееся на вооружении 76-мм орудие ЗИС-5, ослабленная броня и неудачная схема бронирования практически уравнивали новый танк с Т-34 по боевым качествам. Всего было выпущено 1083 танка данной модификации, которые широко применялись на фронтах Великой Отечественной войны.\r\n\r\nПредшественник тяжёлого танка КВ-85.','ussr','hard','V');
INSERT INTO `tank` VALUES ('73','2147483647','7228282','КВ-220 Бета-тест','1020','1020','1020','1020','/instalscript/images/tank/hard/ussr/TankKV-220.png','Разработка КВ-220 на базе тяжёлого танка КВ началась летом 1940 года. Опытный образец был построен 5 декабря. Tанк имел ряд отличительных особенностей: удлинённый корпус, дополнительный опорный каток, увеличенную до 100 мм броневую защиту, а также новую башню с 85-мм пушкой Ф-30. Осенью 1941 года на опытный образец установили башню от серийного КВ, и танк был отправлен на фронт.','ussr','hard','V');
INSERT INTO `tank` VALUES ('74','46650','0','КВ-1','1020','1020','1020','1020','/instalscript/images/tank/hard/ussr/TankKV1.png','Советский тяжёлый танк. Обладает отличным вооружением и бронированием, однако плохими обзором, подвижностью и бронепробитием.\r\n\r\nПредшественник тяжёлых танков КВ-2, КВ-1С и Т-150.','ussr','hard','V');
INSERT INTO `tank` VALUES ('75','33000','0','Pz.Kpfw. B2 740 (f)','549','549','549','549','/instalscript/images/tank/hard/germany/TankB-1bis_captured.png','Немецкий премиумный тяжёлый танк. Машина обладает скорострельным, точным орудием с большим боезапасом. Однако большие габариты, броня с уязвимыми местами и невысокая скорость делают танк хорошей мишенью для артиллерийского огня.','germany','hard','IV');
INSERT INTO `tank` VALUES ('76','33000','0','Durchbruchswagen 2','549','549','549','549','/instalscript/images/tank/hard/germany/TankDW_II.png','Прототип тяжёлого танка. Разрабатывался компанией Henschel und Sohn в рамках программы по созданию тяжёлого танка. Опытный образец был собран в 1938 году. Однако в сентябре 1939 года заказчики отдали предпочтение проекту VK 30.01, и официально программа развития DW была закрыта. Тем не менее прототипы DW I и DW II активно использовались для различных тестов до 1941 года.','germany','hard','IV');
INSERT INTO `tank` VALUES ('77','49500','0','VK 30.01 (H)','639','639','639','639','/instalscript/images/tank/hard/germany/TankVK3001H.png','Немецкий тяжелый танк. Обладает неплохими для своего уровня динамикой и манёвренностью, посредственным бронированием корпуса и прекрасным выбором орудий. Предшественник среднего танка VI уровня VK 30.02 (M) и тяжелого танка VI уровня VK 3601 (H).','germany','hard','VI');
INSERT INTO `tank` VALUES ('78','49500','0','VK 36.01 (H)','639','639','639','639','/instalscript/images/tank/hard/germany/TankVK3601H.png','Немецкий тяжелый танк. Отличается хорошим вооружением, отличной бронёй, но невысокой скоростью. Уникальное коническое орудие обладает отличным бронепробитием и точностью, что позволяет уверенно поражать противников.\r\n\r\nПредшественник тяжёлого танка Tiger I','germany','hard','VI');
INSERT INTO `tank` VALUES ('79','57750','0','Tiger I','729','729','729','729','/instalscript/images/tank/hard/germany/TankPzVI.png','Немецкий тяжёлый танк, обладающий слабым бронированием (по сравнению с танками своего уровня), отличной динамикой, хорошей манёвренностью. Оснащен очень хорошим орудием, что позволяет ему играть роль танка поддержки. Отличная точность и неплохой обзор позволяют играть на любых дистанциях.\r\n\r\nПредшественник тяжелого танка Tiger II.','germany','hard','VII');
INSERT INTO `tank` VALUES ('81','46500','0','T14','675','675','675','675','/instalscript/images/tank/hard/usa/TankT14.png','Американский премиумный тяжёлый танк. Обладает наклонной лобовой бронёй и хорошей для тяжёлого танка подвижностью, однако имеет слабозащищённые борта, что частично компенсируется наличием экранов, поглощающих урон.','usa','hard','V');
INSERT INTO `tank` VALUES ('82','46500','0','T1 Heavy Tank','675','675','675','675','/instalscript/images/tank/hard/usa/TankT1_hvy.png','Тяжелый танк с хорошими динамическими характеристиками и экранной бронёй. Способен издалека серьёзно повредить танки противника, а потом расправиться с ними в ближнем бою. Также, используя скорость и динамику, способен устраивать прорывы по флангам.\r\n\r\nПредшественник тяжёлого танка VI уровня M6.','usa','hard','V');
INSERT INTO `tank` VALUES ('83','55800','0','M6','765','765','765','765','/instalscript/images/tank/hard/usa/TankM6.png','Американский тяжёлый танк. Сочетание хороших углов вертикальной наводки, точности стрельбы с хода и высокой скорострельности позволяет одновременно успешно маневрировать и вести огонь.\r\n\r\nПредшественник тяжёлого танка T29.','usa','hard','VI');
INSERT INTO `tank` VALUES ('84','65100','0','T29','855','855','855','855','/instalscript/images/tank/hard/usa/TankT29.png','Американский тяжелый танк с великолепным бронированием передней части башни и весьма мощным орудием для своего уровня. Отличные вертикальные углы наводки дают преимущества при стрельбе из-за холмов. Однако обладает слабым бронированием корпуса и низкой мобильностью.\r\n\r\nПредшественник тяжёлого танка VIII уровня T32.','usa','hard','VII');
INSERT INTO `tank` VALUES ('85','45000','0','Churchill I','660','660','660','660','/instalscript/images/tank/hard/britain/TankGB08_Churchill_I.png','Британский тяжёлый танк. Обладает низкой мобильностью и посредственной бронёй без углов наклона, но точным и скорострельным орудием.\r\n\r\nПредшественник тяжёлого танка Churchill VII и ПТ-САУ Churchill Gun Carrier\r\n','britain','hard','V');
INSERT INTO `tank` VALUES ('86','45000','0','Excelsior','660','660','660','660','/instalscript/images/tank/hard/britain/TankGB51_Excelsior.png','Премиумный британский тяжёлый танк. Отличается неплохой динамикой, довольно крепкой бронёй и скорострельным орудием. Однако также обладает слабой маской орудия и тонкими бортовыми листами брони.','britain','hard','V');
INSERT INTO `tank` VALUES ('87','54000','0','Churchill VII','730','730','730','730','/instalscript/images/tank/hard/britain/TankGB09_Churchill_VII.png','Британский тяжёлый танк. Дальнейшее развитие Churchill I в плане усиления брони. Однако заплатить за это пришлось значительным снижением скорости в сочетании со слабым, по меркам одноклассников, вооружением. Предшественник тяжёлого танка Black Prince.','britain','hard','VI');
INSERT INTO `tank` VALUES ('88','54000','0','TOG II*','730','730','730','730','/instalscript/images/tank/hard/britain/TankGB63_TOG_II.png','Британский тяжёлый премиум танк. Обладает огромным для своего уровня запасом прочности, скорострельным и точным орудием с высоким показателем урона в минуту. Однако TOG II* имеет среднее бронирование, отличается крайне низкими ходовыми качествами и большими габаритами. С патча 0.9.7 выведен из продажи.','britain','hard','VI');
INSERT INTO `tank` VALUES ('89','63000','0','Black Prince','820','820','820','820','/instalscript/images/tank/hard/britain/TankGB10_Black_Prince.png','Британский тяжёлый танк. Отличается хорошим круговым бронированием при нерациональном наклоне и высоким запасом прочности. Орудие достаточно точное и скорострельное, но имеет относительно низкое пробитие и разовый урон. Является продолжателем традиций своих предшественников и отлично справляется с функцией поддержки союзников. Предшественник тяжёлого танка Caernarvon.','britain','hard','VII');
INSERT INTO `tank` VALUES ('90','34800','0','B1','555','555','555','555','/instalscript/images/tank/hard/france/TankB1.png','Французский тяжёлый танк. Неплохая броня вкупе с большим запасом прочности позволяют выдержать множество попаданий мелкокалиберных снарядов. Но посредственные ходовые качества и низкая бронепробиваемость топового орудия заставляют чувствовать себя неуверенно даже в схватке с одноклассниками, не говоря уже о технике более высокого уровня.\r\n\r\nПредшественник тяжелого танка 5 уровня BDR G1 B.\r\n','france','hard','IV');
INSERT INTO `tank` VALUES ('91','43500','0','BDR G1 B','645','645','645','645','/instalscript/images/tank/hard/france/TankBDR_G1B.png','Французский тяжелый танк. Отличается слабым бронированием и низкой скоростью из-за устаревшей ходовой. Тем не менее, у танка есть и преимущество в виде отличного 90 мм орудия.\r\n\r\nПредшественник тяжёлого танка ARL 44.','france','hard','V');
INSERT INTO `tank` VALUES ('92','52200','0','ARL 44','735','735','735','735','/instalscript/images/tank/hard/france/TankARL_44.png','Французский тяжёлый танк с довольно крепкой наклонной лобовой бронёй, но слабым бронированием бортов и кормы. Мощное вооружение представлено 90-мм и 105-мм орудиями.\r\n\r\nПредшественник тяжёлого танка AMX M4 (1945).','france','hard','VI');
INSERT INTO `tank` VALUES ('93','60900','0','AMX M4 mle. 45','825','825','825','825','/instalscript/images/tank/hard/france/TankAMX_M4_1945.png','Работы по проектированию начались в 1945 году. При создании танка разработчики опирались на идеи, воплощённые в немецком танке Pz.Kpfw. VI Ausf. B Tiger II. Проект был закрыт на стадии подготовки документации. На основе AMX M4 (1945) впоследствии разрабатывался AMX 50 100.\r\n\r\nПредшественник тяжёлого танка AMX 50 100.','france','hard','VII');
INSERT INTO `tank` VALUES ('94','69600','0','AMX 50 100','915','915','915','915','/instalscript/images/tank/hard/france/TankAMX_50_100.png','Французский тяжёлый танк, первый с механизированным заряжанием. Отличается мощным вооружением и высокой подвижностью. Расплатой за это служит слабая броня и долгая перезарядка барабана, во время которой танк практически беспомощен.\r\n\r\nПредшественник тяжёлого танка IX уровня AMX 50 120.','france','hard','VIII');
INSERT INTO `tank` VALUES ('95','58800','0','IS-2','798','798','798','798','/instalscript/images/tank/hard/china/TankCh10_IS2.png','Китайский тяжёлый танк. Отличается неплохой динамикой и мощным, но крайне неточным орудием, имея при этом слабое бронирование лба корпуса.\r\n\r\nПредшественник тяжёлого танка 110.','china','hard','VII');
INSERT INTO `tank` VALUES ('96','67200','0','WZ-111','888','888','888','888','/instalscript/images/tank/hard/china/TankCh03_WZ-111.png','Прототип тяжёлого танка на базе узлов и агрегатов ИС-2 и ИС-3 разрабатывался в начале 1960-х годов под влиянием советского танка Т-10. Машина создавалась для обновления танкового парка НОАК. В ходе испытаний прототипа были выявлены многочисленные недостатки. Разработка была прекращена в 1964 году.','china','hard','VIII');
INSERT INTO `tank` VALUES ('97','67200','0','110','888','888','888','888','/instalscript/images/tank/hard/china/TankCh11_110.png','Тяжёлый китайский танк. Имеет хорошее бронирование и неплохую подвижность, а также точное и скорострельное, но маломощное топовое орудие.\r\n\r\nПредшественник тяжёлого танка WZ-111 model 1-4‎.','china','hard','VIII');
INSERT INTO `tank` VALUES ('98','67200','0','112','888','888','888','888','/instalscript/images/tank/hard/china/TankCh23_112.png','Китайский премиумный тяжёлый танк. Отличается хорошим бронированием, неплохой подвижностью и хорошим уроном, однако орудие имеет слишком низкие показатели пробиваемости, точности и скорострельности.','china','hard','VIII');
INSERT INTO `tank` VALUES ('99','75600','0','WZ-111 model 1-4','978','978','978','978','/instalscript/images/tank/hard/china/TankCh12_111_1_2_3.png','Китайский тяжёлый танк. Обладает отличной подвижностью и хорошим бронированием башен, но посредственным орудием.\r\n\r\nПредшественник тяжёлого танка 113.','china','hard','IX');
INSERT INTO `tank` VALUES ('100','18600','0','T21','255','255','255','255','/instalscript/images/tank/easy/usa/TankT21.png','Американский лёгкий танк, имеющий приличную динамику и маневренность, с возможностью установить стабилизатор вертикальной наводки. Предшественник T71.','usa','easy','VI');
INSERT INTO `tank` VALUES ('101','21700','0','M41 Walker Bulldog','285','285','285','285','/instalscript/images/tank/easy/usa/TankM41_Buildog.png','Являлся дальнейшим развитием опытного танка Т37. К испытаниям прототипов приступили в 1949, а в 1950 был подписан контракт на серийное производство. Танк выпускался компанией Cadillac Motor Car Division, отделением концерна General Motors.','usa','easy','VII');
INSERT INTO `tank` VALUES ('102','24800','0','T49','315','315','315','315','/instalscript/images/tank/easy/usa/TankT49.png','Вариант лёгкого танка М41 с увеличенной башней, вооружённый 90-мм пушкой. Поступил на испытания 5 мая 1954 года. Испытания закончились успешно, однако серийное производство танка развёрнуто не было из-за его невостребованности.','usa','easy','VIII');
INSERT INTO `tank` VALUES ('103','37200','0','M4A3E8 Sherman','510','510','510','510','/instalscript/images/tank/normal/usa/TankM4A3E8_Sherman.png','Американский средний танк. Обладает довольно слабым орудием, высоким силуэтом, слабой бронёй, расположенной под нерациональными углами и невысокой скоростью. Однако это компенсируется отличной манёвренностью и хорошей динамикой, а 76-мм орудие обладает отличной скорострельностью и хорошей точностью на ходу, особенно при наличии стабилизатора.\r\n\r\nПредшественник среднего танка Т20, есть переход на ПТ-САУ M36 Jackson.','usa','normal','VI');
INSERT INTO `tank` VALUES ('104','43400','0','T20','570','570','570','570','/instalscript/images/tank/normal/usa/TankT20.png','Американский средний танк. Довольно слабая броня вынуждает владельца Т20 искать спасения за счет динамичности и маскировки, а так же скрываясь за укрытиями и спинами союзников. Подходит для стрельбы из засад и стремительных рейдов по флангам в обход обороны противника.\r\n\r\nПредшественник среднего танка M26 Pershing','usa','normal','VII');
INSERT INTO `tank` VALUES ('105','49600','0','T69','630','630','630','630','/instalscript/images/tank/normal/usa/TankT69.png','Средний танк с качающейся башней и автоматом заряжания. Разрабатывался на базе опытного среднего танка Т42 в середине 50-х гг. Серийно не выпускался. Предшественник среднего танка T54E1. \r\nВ игре Т69 обладает неплохой динамикой, хорошим обзором и достаточно быстрой перезарядкой барабана.','usa','normal','VIII');
INSERT INTO `tank` VALUES ('106','55800','0','T54E1','690','690','690','690','/instalscript/images/tank/normal/usa/TankT54E1.png','Средний танк с качающейся башней и автоматом заряжания. Разрабатывался в середине 1950-х годов на базе танка M48. Было построено два опытных образца. В ходе испытаний выявилась ненадёжность автомата заряжания, и в 1957 году все работы были свёрнуты.\r\n\r\nОбладает отличным вооружением, неплохой подвижностью, но слабой броней. Предшественник тяжёлого танка 10 уровня T57 Heavy Tank.','usa','normal','IX');
INSERT INTO `tank` VALUES ('107','62000','0','M60','750','750','750','750','/instalscript/images/tank/normal/usa/TankM60.png','Американский специальный средний танк. Выдавался игрокам кланов, занявших места с 1 по 50 по итогам Первой кампании на Глобальной карте, а также ещё 7 командам за достижения в течение кампании. Также был доступен для выбора в качестве одного из подарочных танков по итогам Третьей кампании. Недоступен для покупки за золото.','usa','normal','X');
INSERT INTO `tank` VALUES ('108','74400','0','T32','945','945','945','945','/instalscript/images/tank/hard/usa/TankT32.png','Американский тяжёлый танк. Обладает хорошей лобовой бронёй, расположенной под рациональными углами, непробиваемой маской орудия и хорошими углами наводки.\r\n\r\nПредшественник тяжёлого танка M103.','usa','hard','VIII');
INSERT INTO `tank` VALUES ('109','83700','0','M103','1035','1035','1035','1035','/instalscript/images/tank/hard/usa/TankM103.png','Американский тяжёлый танк. Отличается хорошей мобильностью и мощным вооружением. Лобовая броня способна отразить снаряды даже топовых орудий, в то время как борта и корма танка очень уязвимы.\r\n\r\nПредшественник тяжёлого танка T110E5.','usa','hard','IX');
INSERT INTO `tank` VALUES ('110','93000','0','T57 Heavy Tank','1125','1125','1125','1125','/instalscript/images/tank/hard/usa/TankT57_Heavy.png','Тяжёлый американский танк. Отличается мощным орудием с чрезвычайно высокой скорострельностью для танка с автоматом заряжания, приличной точностью и малым интервалом времени между выстрелами. Однако бронирование танка оставляет желать лучшего, а низкая максимальная скорость и невысокая удельная мощность ограничивают перемещение по карте.','usa','hard','X');
INSERT INTO `tank` VALUES ('111','18600','0','МТ-25','260','260','260','260','/instalscript/images/tank/easy/ussr/TankMT-25.png','Эскизный проект лёгкого колёсно-гусеничного танка. Эскизные работы были закончены в феврале 1943 года. Главной особенностью была конструкция подвески — все опорные катки являлись ведущими. Прототип построен не был. Предшественник лёгкого танка ЛТТБ.','ussr','easy','VI');
INSERT INTO `tank` VALUES ('112','22400','0','ЛТТБ','290','290','290','290','/instalscript/images/tank/easy/ussr/TankLTTB.png','Проект лёгкого танка. Разработка машины велась в начале 1944 года на заводе № 174. Работы завершились на стадии эскизного проектирования и обсуждения тактико-технических требований.','ussr','easy','VII');
INSERT INTO `tank` VALUES ('113','25600','0','Т-54 облегчённый','320','320','320','320','/instalscript/images/tank/easy/ussr/TankT-54S.png','Проект облегчённого варианта среднего танка Т-54. Работы над машиной начались в мае 1949 года. Предполагалось, что данная машина, благодаря повышенной проходимости и манёвренности, сможет быть использована для задач, выполнение которых для обычных серийных танков Т-54 было нецелесообразно. Однако пока шло обсуждение проекта, Т-54 образца 1949 года был доработан и выпущен серийно, и необходимости в облегчённом среднем танке больше не было.','ussr','easy','VIII');
INSERT INTO `tank` VALUES ('114','44800','0','А-44','580','580','580','580','/instalscript/images/tank/normal/ussr/TankA44.png','Советский средний танк. Обладает мощным орудием, высокой максимальной скоростью, хорошей динамикой. Проект был разработан в апреле 1941 года ведущим конструктором завода №183 И. С. Бером. Планировали выпускать машину в трёх вариантах, отличающихся по бронированию, вооружению, боевой массе и скорости. Опытный образец предполагалось выпустить к началу 1942 года, но в связи с началом войны и эвакуацией все работы над танком были прекращены.\r\n\r\nПредшественник среднего танка Объект 416.','ussr','normal','VII');
INSERT INTO `tank` VALUES ('115','51200','0','Объект 416','640','640','640','640','/instalscript/images/tank/normal/ussr/TankObject416.png','Советский средний танк. Разрабатывался в КБ завода №75 с осени 1949 года. Эскизный проект был закончен к марту 1950 года. Из-за проблем с башней экспериментальный образец машины был готов только в конце апреля 1952 г., а доработанный после заводских испытаний опытный образец — летом 1953. Машина прошла испытания, но серийно не выпускалась.\r\n\r\nПредшественник среднего танка Т-54 и Объект 430 Вариант II.','ussr','normal','VIII');
INSERT INTO `tank` VALUES ('116','57600','0','Объект 430 Вариант II','700','700','700','700','/instalscript/images/tank/normal/ussr/TankObject430_II.png','Советский средний танк. Отличается от многих средних танков компоновкой с задним расположением башни. Имеет высокую боевую мощь за счет прочной башни, хорошей стабилизации на ходу и скорострельного орудия, но страдает из-за маленьких углов склонения орудия и вращения башни на 180°\r\n\r\nПредшественник среднего танка Объект 430.','ussr','normal','IX');
INSERT INTO `tank` VALUES ('117','64000','0','Объект 430','760','760','760','760','/instalscript/images/tank/normal/ussr/TankObject430.png','Советский средний танк.\r\n\r\nОтличается хорошим бронированием проекций корпуса и башни, однако более слабые показатели орудия относительно своих одноклассников по нации заставляют избирать несколько иную тактику действия на этом танке.','ussr','normal','X');
INSERT INTO `tank` VALUES ('118','57600','0','КВ-2','1110','1110','1110','1110','/instalscript/images/tank/hard/ussr/TankKV2.png','Советский тяжёлый танк. Обладает отличным вооружением, но слабым бронированием и малой дальностью обзора. На выбор в танк можно поставить как сбалансированное 107 мм орудие ЗиС-6, так и 152-мм гаубицу М-10 с высоким уроном, но низкой точностью и долгой перезарядкой.\r\n\r\nИмеются переходы на тяжёлый танк Т-150 и САУ С-51.','ussr','hard','VI');
INSERT INTO `tank` VALUES ('119','67200','0','ИС','1200','1200','1200','1200','/instalscript/images/tank/hard/ussr/TankIS.png','Советский тяжёлый танк. Обладает хорошей динамикой, но посредственной бронёй. Благодаря мощному вооружению танк хорошо показывает себя на ближних и средних дистанциях боя, на дальних дистанциях эффективность падает из-за плохого обзора, низкой точности и долгого сведения. Предшественник тяжелого танка ИС-3.','ussr','hard','VII');
INSERT INTO `tank` VALUES ('120','74400','0','ИС-3','1290','1290','1290','1290','/instalscript/images/tank/hard/ussr/TankIS3.png','Советский тяжёлый танк, предназначен для штурма или фланговых атак. Обладает великолепным бронированием, хорошей скоростью, мощным вооружением с долгим сведением и низкой точностью, плохим обзором и плохим склонением орудия вниз.\r\n\r\nПредшественник тяжёлого танка Т-10.','ussr','hard','VIII');
INSERT INTO `tank` VALUES ('121','86400','0','Т-10','1380','1380','1380','1380','/instalscript/images/tank/hard/ussr/TankT10.png','Тяжёлый советский танк. Обладает хорошим скорострельным вооружением и отличной подвижностью, а также слабым бронированием и большим разовым уроном. Предшественник тяжёлого танка ИС-7.','ussr','hard','IX');
INSERT INTO `tank` VALUES ('122','96000','0','ИС-7','1470','1470','1470','1470','/instalscript/images/tank/hard/ussr/TankIS7.png','Советский тяжёлый танк, обладает великолепной лобовой бронёй и хорошей подвижностью, однако не самым мощным орудием. Предназначен для решения самых разных задач на поле боя.','ussr','hard','X');
INSERT INTO `tank` VALUES ('123','19600','0','Type 62','266','266','266','266','/instalscript/images/tank/easy/china/TankType62.png','Китайский премиумный лёгкий танк. Отличается хорошим обзором, подвижностью и мощным вооружением, однако посредственной динамикой и проходимостью.','china','easy','VII');
INSERT INTO `tank` VALUES ('124','22400','0','WZ-132','296','296','296','296','/instalscript/images/tank/easy/china/TankWZ132.png','Китайский лёгкий танк. Отличается мощным вооружением и относительно неплохой подвижностью. Из недостатков — сравнительно низкая удельная мощность и большие габариты.  Предшественник среднего танка WZ-120.','china','easy','VIII');
INSERT INTO `tank` VALUES ('125','50400','0','WZ-120','652','652','652','652','/instalscript/images/tank/normal/china/TankWZ120.png','Китайский средний танк. Обладает неплохими динамическими характеристиками и выбором из топовых орудий, однако слабой лобовой броней и плохими углами склонения 122 мм орудия.\r\n\r\nПредшественник среднего танка 121.','china','normal','IX');
INSERT INTO `tank` VALUES ('126','36000','0','121','712','712','712','712','/instalscript/images/tank/normal/china/Tank121.png','Китайский средний танк. Отличается неплохой динамикой, чрезвычайно мощным вооружением в виде 122 мм пушки и неплохим бронированием, однако плохими углами вертикального наведения орудия.','china','normal','X');
INSERT INTO `tank` VALUES ('127','84000','0','113','1068','1068','1068','1068','/instalscript/images/tank/hard/china/Tank113.png','Китайский тяжёлый танк. Отличается хорошей динамикой и неплохим бронированием, однако длинный корпус, низкое бронепробитие и отсутствие хорошего отрицательного угла вертикальной наводки осложняют игру на этой машине.','china','hard','X');
INSERT INTO `tank` VALUES ('128','36000','0','Type 4 Chi-To','500','500','500','500','/instalscript/images/tank/normal/japan/TankChi_To.png','Средний танк Type 4 Chi-To разработан в 1943 г. на базе Chi-Nu. Предполагалось, что машина заменит устаревшие танки Chi-Ha, но проблемы с сырьём и комплектующими не позволили развернуть серийное производство. Всего было выпущено шесть шасси и собрано два танка на их базе.\r\n\r\nПредшественник среднего танка Type 5 Chi-Ri.','japan','normal','VI');
INSERT INTO `tank` VALUES ('129','42000','0','Type 5 Chi-Ri','560','560','560','560','/instalscript/images/tank/normal/japan/TankChi_Ri.png','Японский средний танк. Основной особенностью является наличие барабана заряжания на 3 снаряда с быстрой перезарядкой как всей кассеты, так и внутри барабана. Но большие габариты и плохие динамические характеристики делают его применение на поле боя как классического СТ довольно трудным.\r\nПредшественник среднего танка STA-1.','japan','normal','VII');
INSERT INTO `tank` VALUES ('130','48000','0','STA-1','620','620','620','620','/instalscript/images/tank/normal/japan/TankSTA_1.png','Первый японский послевоенный танк разрабатывался на базе американских машин с учётом специфики японского рельефа, железнодорожной сети и антропометрических данных японских танкистов. Был выпущен один опытный образец в декабре 1956 года. Из достоинств танка стоит выделить орудие с хорошим пробитием и скорострельностью и хорошую динамику, а из недостатков — «картонное бронирование», невысокую скорость.\r\n\r\nПредшественник среднего танка Type 61.','japan','normal','VIII');
INSERT INTO `tank` VALUES ('131','54000','0','Type 61','680','680','680','680','/instalscript/images/tank/normal/japan/TankType_61.png','Первый танк, спроектированный в Японии после окончания Второй мировой войны. Разрабатывался в 1954–1961 годах на основе американского танка M47. Конструкторы уменьшили размеры и облегчили бронирование исходной машины. Это значительно снизило вес танка, сделав его более приспособленным к особым требованиям вооружённых сил Японии.\r\n\r\nПредшественник среднего танка STB-1.','japan','normal','IX');
INSERT INTO `tank` VALUES ('132','60000','0','STB-1','740','740','740','740','/instalscript/images/tank/normal/japan/TankSTB_1.png','В начале 60-х годов фирма Mitsubishi начала разработку нового танка, отвечавшего всем требованиям к вооружению и защите. Первые два прототипа STB-1 были выпущены в сентябре 1969 года для ходовых испытаний. В 1970 году прототипы были продемонстрированы прессе и приняли участие в военном параде.','japan','normal','X');
INSERT INTO `tank` VALUES ('133','27000','0','Type 91 Heavy','480','480','480','480','/instalscript/images/tank/hard/japan/TankType_91_Heavy.png','Разработка трёхбашенного 18-тонного японского танка Type 91 началась в 1927 и закончилась в 1932 году. Серийно не производился. Произведён единственный опытный экземпляр.','japan','hard','III');
INSERT INTO `tank` VALUES ('134','36000','0','Type 95 Heavy','570','570','570','570','/instalscript/images/tank/hard/japan/TankType_95_Heavy.png','Японский тяжёлый танк Type 95 был создан на базе танка Type 91. Это многобашенный танк межвоенного периода, позаимствовавший наработки европейского танкостроения. В главной башне располагалось 70-мм орудие, также танк был оборудован 37-мм пушкой и двумя 6,5-мм пулемётами. Было изготовлено 4 прототипа.','japan','hard','IV');
INSERT INTO `tank` VALUES ('135','45000','0','O-I Experimental','660','660','660','660','/instalscript/images/tank/hard/japan/TankO_I_Exp.png','Полковник Ивакуро из Министерства Армии инициировал разработку тяжёлого танка в 1939 году. Машина разрабатывалась компанией Mitsubishi, поэтому в некоторых кругах танк стал известен как Mi-To, однако в армии машина называлась O-I. Подробности проекта неизвестны.','japan','hard','V');
INSERT INTO `tank` VALUES ('136','54000','0','Heavy Tank No. VI','750','750','750','750','/instalscript/images/tank/hard/japan/TankHeavy_No_VI.png','В 1943 году японский посол в Германии присутствовал на испытаниях «Тигров» на полигоне Henschel. После этого компания получила приказ передать всю документацию по данному танку японской стороне. Одна машина была отправлена в Бордо 14 октября 1943 года для доставки в разобранном виде на подводной лодке. Японской стороне не удалось ни доставить танк, ни наладить собственное производство. Эта авантюра обошлась им в 645 000 рейхсмарок при себестоимости танка 300 000 рейхсмарок. ','japan','hard','VI');
INSERT INTO `tank` VALUES ('137','63000','0','O-Ni','840','840','840','840','/instalscript/images/tank/hard/japan/TankO_Ni.png','Дальнейшее развитие O-I с улучшенным противотанковым вооружением. Военным руководством планировалось доработать ранние модели и достигнуть лучшего уровня защиты. Работы были прекращены на стадии проектирования. Танк в завершённом виде построен не был, в боевых действиях не применялся.','japan','hard','VII');
INSERT INTO `tank` VALUES ('138','72000','0','O-Ho','930','930','930','930','/instalscript/images/tank/hard/japan/TankO_Ho.png','O-Ho был дальнейшим развитием идеи сверхтяжёлого танка с улучшенной бронезащитой. Танк имел неплохое вооружение, дающее возможность вести круговой обстрел. Проект машины был свёрнут в связи с окончанием войны. Танк в завершённом виде построен не был, в боевых действиях не применялся.','japan','hard','VIII');
INSERT INTO `tank` VALUES ('139','81000','0','Type 4 Heavy','1020','1020','1020','1020','/instalscript/images/tank/hard/japan/TankType_4_Heavy.png','Type 4, известный также как Type 2604 — один из вариантов сверхтяжёлого танка O-I, разработанного в годы Второй мировой войны. Основными задачами танка были прорыв укреплённых полос противника и береговая оборона.','japan','hard','IX');
INSERT INTO `tank` VALUES ('140','90000','0','Type 5 Heavy','1110','1110','1110','1110','/instalscript/images/tank/hard/japan/TankType_5_Heavy.png','Type 5, известный также как Type 2605 — один из вариантов сверхтяжёлого танка O-I, разработанного в годы Второй мировой войны. Основными задачами танка были прорыв укреплённых полос противника и береговая оборона.','japan','hard','X');
INSERT INTO `tank` VALUES ('141','17400','0','AMX 12 t','245','245','245','245','/instalscript/images/tank/easy/france/TankAMX_12_t.png','Французский лёгкий танк. Первый из серии французских лёгких танков, оснащённых барабаном заряжания на 6 снарядов. Обладает посредственной скоростью и динамикой, что затрудняет или делает невозможным применение танка как разведчика, однако неплохие показатели орудия способствуют успешному применению танка в роли поддержки.\r\n\r\nПредшественник лёгкого танка AMX 13 75; имеется переход на САУ AMX 13 F3 AM.\r\n','france','easy','VI');
INSERT INTO `tank` VALUES ('142','20300','0','AMX 13 75','275','275','275','275','/instalscript/images/tank/easy/france/TankAMX_13_75.png','Французский лёгкий танк, оснащённый барабаном заряжания. Имеет отличную топовую пушку и неплохие динамические характеристики. Однако бронирование танка даже хуже, чем у предшественника, да и не слишком большой боекомплект и уязвимость танка при перезарядке барабана заставляют крайне тщательно вести огонь по противнику.\r\n\r\nПредшественник лёгкого танка AMX 13 90.','france','easy','VII');
INSERT INTO `tank` VALUES ('143','23200','0','AMX 13 90','275','275','275','275','/instalscript/images/tank/easy/france/TankAMX_13_90.png','Французский лёгкий танк. Обладает большой огневой мощью за счёт высокого темпа стрельбы с использованием механизированного заряжания и хорошей динамикой. Однако слабое бронирование и долгая перезарядка барабана требуют нестандартных способов ведения боя.\r\n\r\nПредшественник средних танков Lorraine 40t и AMX 30 1er prototype.','france','easy','VIII');
INSERT INTO `tank` VALUES ('144','78300','0','AMX 50 120','1005','1005','1005','1005','/instalscript/images/tank/hard/france/TankAMX_50_120.png','Французский тяжёлый танк. Противоречивая машина: слабая броня корпуса и огромные размеры, но мощное и скорострельное орудие. Он предназначен для поддержки атак своей команды, однако из-за большого силуэта и низких углов вертикальной наводки плохо подходит для засад. Так как танк беспомощен во время долгой перезарядки барабана, следует держаться второй линии атаки и не лезть на рожон.\r\n\r\nПредшественник тяжёлого танка 10 уровня AMX 50B.','france','hard','IX');
INSERT INTO `tank` VALUES ('145','87000','0','AMX 50 B','1095','1095','1095','1095','/instalscript/images/tank/hard/france/TankAMX_50_B.png','Французский тяжёлый танк. Самый быстрый и манёвренный тяжёлый танк, обладающий точным орудием с барабаном заряжания. Однако не самое быстрое сведение пушки и очень слабое бронирование делает танк уязвимым для любого противника и вынуждает играть максимально аккуратно.','france','hard','X');
INSERT INTO `tank` VALUES ('146','16500','0','VK 28.01','243','243','243','243','/instalscript/images/tank/easy/germany/TankVK_28_01.png','Немецкий лёгкий танк. Отличается неплохим для своего класса вооружением и бронированием. Однако это отрицательно сказывается на динамике, заметности и манёвренности танка.\r\n\r\nПредшественник танка Spähpanzer SP I C.','germany','easy','VI');
INSERT INTO `tank` VALUES ('147','19250','0','Spähpanzer SP I C','273','273','273','273','/instalscript/images/tank/easy/germany/TankSP_I_C.png','Для повышения огневой мощи и улучшения противотанковых возможностей танкоразведывательных батальонов с 1956 по 1962 год проводились работы по созданию разведывательного истребителя танков. Для этого планировалась установка на боевую разведывательную машину 90-мм противотанкового орудия. Над проектом работали компании Hotchkiss и Klöckner-Humboldt-Deutz. Проект так и не был принят, количество построенных прототипов неизвестно.','germany','easy','VII');
INSERT INTO `tank` VALUES ('148','22000','0','Spähpanzer Ru 251','303','303','303','303','/instalscript/images/tank/easy/germany/TankRu_251.png','Немецкий легкий танк, обладающий высокой максимальной скоростью, отличным орудием и хорошей маскировкой. Предшественник танка Leopard Prototyp A.','germany','easy','VIII');
INSERT INTO `tank` VALUES ('149','27500','0','Pz.Kpfw. III/IV','326','326','326','326','/instalscript/images/tank/normal/germany/TankPzIII_IV.png','Попытка создать единый танк на базе Pz III и Pz IV. Немецкий средний танк с неплохим лобовым бронированием корпуса, а также хорошими скоростью и динамическими характеристиками. Однако точность орудия и обзор невелики, что вынуждает действовать активно и рискованно. Предшественник VK 30.01 (D).','germany','normal','V');
INSERT INTO `tank` VALUES ('150','33000','0','Pz.Kpfw. V/IV','386','386','386','386','/instalscript/images/tank/normal/germany/TankPzV_IV.png','Немецкий средний акционный танк. Обладает хорошими динамическими характеристиками. Относительно слабую пушку и слабую лобовую броню можно компенсировать манёвренностью и высокой прочностью, что позволяет зайти врагу в борт. Также, не стоит пренебрегать и подкалиберными снарядами, которые способны облегчить жизнь.','germany','normal','VI');
INSERT INTO `tank` VALUES ('151','38500','0','VK 30.02 (D)','446','446','446','446','/instalscript/images/tank/normal/germany/TankVK_30_02_D.png','Немецкий средний танк. Отличается высокой подвижностью и надёжным лобовым бронированием. Может использоваться как в первой линии, так и в качестве машины поддержки. Предшественник среднего танка Indien-Panzer.','germany','normal','VII');
INSERT INTO `tank` VALUES ('152','44000','0','Indien-Panzer','506','506','506','506','/instalscript/images/tank/normal/germany/TankIndien_Panzer.png','Немецкий средний танк. Обладает точным, пробивным и скорострельным орудием с хорошими углами вертикальной наводки, слабым двигателем и посредственным бронированием. Предшественник среднего танка Leopard prototyp A.','germany','normal','VIII');
INSERT INTO `tank` VALUES ('153','49500','0','E 50','566','566','566','566','/instalscript/images/tank/normal/germany/TankE_50.png','Немецкий средний танк. Отличается точным и мощным вооружением, но посредственной подвижностью и манёвренностью. Отлично действует на дальних дистанциях, но и в ближнем бою может оказаться опасен для одноклассников — сочетание максимальной скорости в 60 км/ч и массы более 60 тонн позволяет успешно таранить даже тяжёлые танки, не говоря уже о средних и лёгких машинах.\r\n\r\nПредшественник среднего танка E-50 Ausf. M.','germany','normal','IX');
INSERT INTO `tank` VALUES ('154','55000','0','E 50 Ausf. M','626','626','626','626','/instalscript/images/tank/normal/germany/TankE_50_Ausf_M.png','Немецкий средний танк. Является улучшенной модификацией танка E-50. Несмотря на внешнее сходство со своим предшественником, E-50 Ausf.M обладает рядом ключевых преимуществ: повышенная маневренность, превосходное орудие и заднее расположение трансмиссии. Среди сохранившихся недостатков можно отметить: слабое бронирование бортов, высокий силуэт, долгий разгон.','germany','normal','X');
INSERT INTO `tank` VALUES ('155','66000','0','Tiger II','819','819','819','819','/instalscript/images/tank/hard/germany/TankTiger_II.png','Немецкий тяжёлый танк. Обладает хорошей манёвренностью и крепким лобовым бронированием. Точное орудие и высокий обзор дают преимущество на открытых пространствах. В ближнем бою PzKpfw VIB Tiger II уязвим из-за слабого бронирования бортов и кормы, а также центрального расположения башни.\r\n\r\nПредшественник тяжёлого танка E-75.','germany','hard','VIII');
INSERT INTO `tank` VALUES ('156','74250','0','E 75','909','909','909','909','/instalscript/images/tank/hard/germany/TankE_75.png','Немецкий тяжёлый танк, обладает прекрасными подвижностью и бронированием. Уверенно чувствует себя как в обороне, так и на острие атаки. В 1945 году E-75 должен был стать основным немецким тяжёлым танком, заменив собой «Tiger II», но работы над танком не вышли за стадию эскизного проектирования.\r\n\r\nПредшественник сверхтяжёлого танка E-100.','germany','hard','IX');
INSERT INTO `tank` VALUES ('157','82500','0','E 100','999','999','999','999','/instalscript/images/tank/hard/germany/TankE_100.png','Немецкий тяжёлый танк. Обладает мощным орудием и надёжной броней, однако довольно низкой подвижностью.','germany','hard','X');
INSERT INTO `tank` VALUES ('158','82500','0','Maus','999','999','999','999','/instalscript/images/tank/hard/germany/TankMaus.png','Немецкий тяжёлый танк. Самый бронированный и самый живучий танк в игре. Обладает орудием с высоким разовым уроном, посредственными точностью и бронепробиваемостью и долгой перезарядкой. Однако в силу крайне низкой подвижности и огромных размеров является лёгкой мишенью для САУ противника.','germany','hard','X');
INSERT INTO `tank` VALUES ('159','3000','0','Sherman III','440','440','440','440','/instalscript/images/tank/normal/britain/TankSherman_III.png','Американский средний танк М4А2 поставлялся по ленд-лизу в Великобританию, где получил обозначение Sherman III. Основной особенностью М4А2 был дизельный двигатель. Всего за годы войны в Великобританию было поставлено 5045 танков этого типа.','britain','normal','V');
INSERT INTO `tank` VALUES ('160','36000','0','Sherman Firefly','500','500','500','500','/instalscript/images/tank/normal/britain/TankSherman_Firefly.png','Британский вариант американского танка М4 Sherman. Разработан в начале 1944 года. Основные отличия заключались в установке более мощного 17-фунтового орудия, размещении радиостанции и боекомплекта, отказе от курсового пулемёта, отсутствием места для ассистента механика-водителя. Всего в 1944–1945 гг. было выпущено около 2100–2300 машин всех модификаций.','britain','normal','VI');
INSERT INTO `tank` VALUES ('161','42000','0','Comet','560','560','560','560','/instalscript/images/tank/normal/britain/TankComet.png','Британский средний танк. Отличается хорошими ходовыми качествами и имеет неплохое скорострельное орудие с приемлемой бронепробиваемостью, однако обладает очень плохой бронёй для своего уровня.\r\n\r\nПредшественник среднего танка Centurion Mk. I.','britain','normal','VII');
INSERT INTO `tank` VALUES ('162','48000','0','Centurion Mk. I','620','620','620','620','/instalscript/images/tank/normal/britain/TankCenturion_Mk_I.png','Британский средний танк. Обладает неплохой подвижностью, но низкой максимальной скоростью. Имеет точное и скорострельное орудие с высоким показателем урона в минуту. Как и предшественники, хорошо подходит на роль танка поддержки. Является предшественником среднего танка Centurion Mk. 7/1.','britain','normal','VIII');
INSERT INTO `tank` VALUES ('163','54000','0','Centurion Mk. 7/1','680','680','680','680','/instalscript/images/tank/normal/britain/TankCenturion_Mk_7_1.png','Британский средний танк. Отличается хорошей динамикой, превосходным орудием с большим углом вертикальной наводки. В то же время обладает низкой максимальной скоростью и недостаточным бронированием, что при больших габаритах машины делает из неё лёгкую мишень.\r\n\r\nПредшественник среднего танка Centurion Action X.','britain','normal','IX');
INSERT INTO `tank` VALUES ('164','60000','0','Centurion Action X','740','740','740','740','/instalscript/images/tank/normal/britain/TankCenturion_Action_X.png','Башню Action X предполагалось использовать на танках Centurion более поздних модификаций. Один прототип башни был установлен на шасси танка Centurion Mark 7, ещё один использовался для баллистических испытаний. Танки с башней Action X серийно не выпускались, на вооружении не состояли.','britain','normal','X');
INSERT INTO `tank` VALUES ('165','72000','0','Caernarvon','910','910','910','910','/instalscript/images/tank/hard/britain/TankCaernarvon.png','Прототип тяжёлого танка Conqueror, но с башней и вооружением от танка Centurion. За счёт точного и пробивного орудия хорошо показывает себя на дальней дистанции, однако в ближнем бою могут быть проблемы из-за слабости брони и низкого разового урона. Предшественник тяжёлого танка Conqueror.','britain','hard','VIII');
INSERT INTO `tank` VALUES ('166','81000','0','Conqueror','1000','1000','1000','1000','/instalscript/images/tank/hard/britain/TankConqueror.png','Британский тяжёлый танк. Обладает точным скорострельным орудием. Главным недостатком является слабое бронирование. Предшественник тяжёлого танка FV215b.','britain','hard','IX');
INSERT INTO `tank` VALUES ('167','90000','0','FV215b','1090','1090','1090','1090','/instalscript/images/tank/hard/britain/TankFV215b.png','Британский тяжёлый танк. Выделяется на фоне аналогов самым скорострельным и точным орудием, а также отличной динамикой, но большими размерами и посредственным бронированием, что частично компенсируется большим запасом прочности.','britain','hard','X');
INSERT INTO `tank` VALUES ('168','0','1000','Тетрарх','150','150','150','150','/instalscript/images/tank/prem/ussr/Tetrarch.png','Советский лёгкий танк второго уровня. Обладает отличным вооружением, хорошей скоростью и мощной рацией. Среди недостатков — малый боезапас, слабая броня, плохой обзор и проблемы с проходимостью на слабых и топких грунтах.','ussr','prem','II');
INSERT INTO `tank` VALUES ('169','0','2000','ЛТП','250','250','250','250','/instalscript/images/tank/prem/ussr/LTP.png','Советский лёгкий танк третьего уровня. Не отличается скоростью, но очень маневренный. В силу малых габаритов подходит на роль пассивного светляка.','ussr','prem','III');
INSERT INTO `tank` VALUES ('170','0','2500','Валентайн II','250','150','250','350','/instalscript/images/tank/prem/britain/Valentine.png\n','Лёгкий танк 4 уровня, отличается хорошей бронёй, низким силуэтом, отличным обзором и манёвренностью. Однако низкая скорость не позволяет действовать как лёгкий танк, а слабое орудие с ограниченным боезапасом вынуждает выцеливать слабые места и не стрелять понапрасну.','britain','prem','IV');
INSERT INTO `tank` VALUES ('171','0','3500','Pz.Kpfw. B2 740 (f','300','200','250','350','/instalscript/images/tank/prem/germany/AnnoB-1bis_captured.png','Немецкий премиумный тяжёлый танк пятого уровня. Машина обладает скорострельным, точным орудием с большим боезапасом. Однако большие габариты, броня с уязвимыми местами и невысокая скорость делают танк хорошей мишенью для артиллерийского огня.','germany','prem','V');
INSERT INTO `tank` VALUES ('172','0','4500','Dicker Max','300','300','300','300','/instalscript/images/tank/prem/germany/AnnoDickerMax.png','Немецкая премиумная противотанковая САУ шестого уровня, обладает низкой подвижностью, отличными углами склонения ствола и очень мощным для своего уровня орудием. Открытая рубка обеспечивает отличный обзор, но негативно сказывается на живучести машины — её тонкая броня легко пробивается снарядами практически всех орудий.','germany','prem','VI');
INSERT INTO `tank` VALUES ('173','0','5500','E 25','300','300','350','350','/instalscript/images/tank/prem/germany/AnnoE-25.png','Немецкая премиумная ПТ-САУ седьмого уровня. Является одной из самых компактных машин в игре, обладает динамикой разгона на уровне легких танков и неплохой маневренностью, а также высокой скорострельностью и точностью. Однако пушка от ПТ-САУ двумя уровнями ниже ограничивает боевое применение данной самоходки, а плотная компоновка способствует частым повреждениям и пожарам.','germany','prem','VII');
INSERT INTO `tank` VALUES ('174','0','6500','Löwe','450','400','350','750','/instalscript/images/tank/prem/germany/AnnoLowe.png','Немецкий премиумный тяжёлый танк восьмого уровня, обладает отличным высокоточным вооружением, но посредственным бронированием корпуса и плохой подвижностью. В основном используется в роли тяжёлого танка поддержки, которым удобно держать неприкрытые фланги. Несколько таких танков в команде могут полностью изменить картину боя всего за пару минут.','germany','prem','VIII');
INSERT INTO `tank` VALUES ('175','0','7500','T34','400','450','400','800','/instalscript/images/tank/prem/usa/AnnoT34_hvy.png','Американский премиумный тяжёлый танк восьмого уровня. Обладает слабым бронированием корпуса и крупными габаритами, но хорошим вооружением и отличным бронированием лба башни. Хорошо подходит для поддержки атаки или стрельбы по чужой разведке.','usa','prem','VIII');
INSERT INTO `tank` VALUES ('176','0','2147483647','ИС-3 Защитник','1900','2340','1800','1500','/instalscript/images/nat/TankIS-3Defender.png','В 1956–1957 годах слушатели Академии БТВ разработали дипломный проект установки механизма заряжания для тяжёлых танков ИС-3 и Т-10. В варианте для ИС-3 была предусмотрена двухрядная боеукладка магазинного типа. Экипаж был сокращён до трёх человек: командир, наводчик, механик-водитель. По официальным данным этот танк так и остался проектным образцом, но британская разведка докладывала, что было произведено несколько десятков тысяч танков, законсервированных на секретном складе.','ussr','hard','VIII');
INSERT INTO `tank` VALUES ('177','0','2147483647','T28 Defender','2300','2340','2000','2000','/instalscript/images/nat/TankT28Defender.png','T28 Defender — секретный проект боевой машины особого назначения на базе T28 Prototype. Самоходка получила усиленную броню, экспериментальное барабанное орудие-рельсотрон на 3 снаряда и сверхсекретный двигатель повышенной мощности.','usa','pt-sau','VIII');
INSERT INTO `tank` VALUES ('178','6400000','100','Jagd. Pz E100','4000','3500','2500','2000','/instalscript/images/nat/TankJagdE100.png','Немецкая пт-сау с отличной броней и более-менее точным орудием','germany','pt-sau','X');
INSERT INTO `tank` VALUES ('179','7000000','0','Grille 15','3000','1000','3500','3000','/instalscript/images/nat/TankGrille15.png','пусто','germany','pt-sau','X');
INSERT INTO `tank` VALUES ('181','0','21000','Type 121 premium','1550','1550','1550','1550','/instalscript/images/tank/prem/china/121.png','Китайский премиумный танк десятого уровня. Отличаеться точностью и силой атаки, почти не имеет недостатков,кроме уязвимой боеукладки. В бою может выполнять как роль наступления так и оборонительную,хорош для разветки и лобовой атаки.А так же большой плюс для тяжолого танка это скорость и маневренность!!!','china','prem','X');
